import React from "react";
import styles from "./LoadingStarted.module.css";
import animationLoading from '../../Animation/Loading.json'

const LoadingStarted = () => {
  return (
    <>
      <div className={styles.head}>
       <h1 className={`text-light d-flex justify-content-center align-items-center h-100 ${styles.logo}`}>Safe Pay</h1>
          <h1 className={`text-light d-flex justify-content-center align-items-center h-100 ${styles.logo}`}>Aravind</h1>
           <Lottie animationData={animationLoading} loop={true} style={{ height: 300, width: 300 }} />
      </div>
    </>
  );
};

export default LoadingStarted;
